import BooksCard from "./BooksCard";

function Books({ books }) {

    const mappedBooks = books.map(book => {
        return (
            <BooksCard key={book.id} />
        )
    })

    return ( 
        <div>
            {mappedBooks}
        </div>
    )
};

export default Books
